import React from 'react'
import './MovieCard.scss'

export default function MovieCard(props) {
    const {
        Title: title,
        Year: year,
        imdbID: id,
        Type: type,
        Poster: poster
    } = props

    return(
        <div className='MovieCard' id={id}>
            <img src={poster} alt={title} className="MovieCard-poster"/>
            <div className='MovieCard-content'>
                <h3>
                    {title}
                </h3>
                <p>
                    {year}
                    <span>
                        {type}
                    </span>
                </p>
            </div>
        </div>
    )
}
